import './App.css';
import data from './data';
import Display from './Display';

function App() {

  console.log(Display);
  function printConsole() {
    data.forEach(function (item) {
      console.log(item.name, item.price, item.pictures, item.seller);
    })
  };

  printConsole();

  return (
    <div className="App">

      <section>
      <div>
        <Display name={data[0].name}
          price={data[0].price}
          pictures={data[0].pictures}   
          />
      </div>
      <div>{data[0].seller.name}</div>
      <div>{data[0].seller.firstName}</div> 
      <div>{data[0].seller.phoneNumber}</div> 
      <div>{data[0].seller.address}</div> 
      <div>{data[0].location.city}</div>
      <div>{data[0].location.country}</div> 
      <div>{data[0].location.street}</div> 
      <div>{data[0].location.zipCode}</div>

      </section>

    <section>

      <div>
        <Display name={data[1].name} 
        price={data[1].price} 
        pictures={data[1].pictures} />
      </div>
      <div>{data[1].seller.name}</div>
      <div>{data[1].seller.firstName}</div> 
      <div>{data[1].seller.phoneNumber}</div> 
      <div>{data[1].seller.address}</div> 
    </section>

      <section>

      <div>
        <Display name={data[2].name} 
        price={data[2].price} 
        pictures={data[2].pictures} />
      </div>
      <div>{data[2].seller.name}</div>
      <div>{data[2].seller.firstName}</div> 
      <div>{data[2].seller.phoneNumber}</div> 
      <div>{data[2].seller.address}</div> 
      </section>

<section>

      <div>
        <Display name={data[3].name} 
        price={data[3].price} 
        pictures={data[3].pictures} />
      </div>
      <div>{data[3].seller.name}</div>
      <div>{data[3].seller.firstName}</div> 
      <div>{data[3].seller.phoneNumber}</div> 
      <div>{data[3].seller.address}</div> 
</section>

<section>

      <div>
        <Display name={data[4].name} 
        price={data[4].price} 
        pictures={data[4].pictures} />
      </div>
      <div>{data[4].seller.name}</div>
      <div>{data[4].seller.firstName}</div> 
      <div>{data[4].seller.phoneNumber}</div> 
      <div>{data[4].seller.address}</div> 

</section>

    </div>
  );
}

export default App;
